import React from "react";
import "./Home.css";
import Navbar from "../../components/Navbar/Navbar";
import Header from "../../components/Header/Header";
import { useNavigate } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Carousel from "react-bootstrap/Carousel";
import { assets } from "../../assets/assets";
import { Link } from "react-router-dom";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader

function Home() {
  const navigate = useNavigate();
  return (
    <>
      <div className="carousel">
        <Carousel>
          <Carousel.Item>
            <img src={assets.bg} className="image" />
            <Carousel.Caption>
              <span>Beach</span>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img src={assets.bg2} className="image" />
            <Carousel.Caption>
              <span>Nine Arch Bridge</span>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img src={assets.bg3} className="image" />
            <Carousel.Caption>
              <span>Kandy Lake</span>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img src={assets.bg4} className="image" />
            <Carousel.Caption>
              <span>Sigiriya Antient  Rock</span>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
      <div className="title-container">
        <h3>SR Recuiters and Travellers</h3>
        <h4>We Are From Sri Lanka</h4>
      </div>
      <div id = ""className="employee-btn-container">
        <button>See Employee</button>
      </div>
    </>
  );
}

export default Home;
